import styles from "./Header.module.css";

const Header = () => {
  return (
    <header className={styles.header}>
      <h1>Banking Application</h1>
      <nav>
        <button className={styles.action}>Click Me</button>
      </nav>
    </header>
  );
};

export default Header;
